// BundleFromImage returns the Bundle with the given image
func BundleFromImage(image string) (*Bundle, error) {
	for _, bundle := range knownBundles {
		if image == bundle.Image {
			copiedBundle := bundle
			return &copiedBundle, nil
		}
	}
	return nil, fmt.Errorf("No known bundle matches image %s", image)
}

// BundleFromName returns the Bundle with the given name
func BundleFromName(name string) (*Bundle, error) {
	for _, bundle := range knownBundles {
		if name == bundle.Name {
			copiedBundle := bundle
			return &copiedBundle, nil
		}
	}
	return nil, fmt.Errorf("No known bundle matches name %s", name)
}
